        "title": "劍龍稜、鋸齒稜接無耳茶壺山",
        "excerpt":"2018年5月27日，這一天破了歷年來的五月最高溫紀錄。太平洋高壓籠罩在台灣上空，真不知道該說天氣很好還是很不好。出來玩總會祈禱遇到大晴天，可是天氣太晴朗也是會把人曬昏頭，尤其是劍龍稜上，。台北測到38.2度的高溫。那我猜我們在劍龍稜跟鋸齒稜上的溫度應該有超過40度。有幾段路都沒有植披，裸露的大岩石直接在大太陽上曝曬，溫度應該都超過50度了，抓在上面還會燙手。貼著滾燙燙的岩壁，頭頂著烈日，差點變成劍龍稜上的石板烤肉。在稜線上陡上前進，我開始思考這種天氣到底是好還是壞。 粗略行程: 三重=&gt;國光客運1802往基隆=&gt;基隆客運791往南雅社區-&gt;南子吝山稜線-&gt;下切半平溪-&gt;上接劍龍鋸齒稜-&gt;無耳茶壺山-&gt;下勸濟堂=&gt;基隆客運1062回忠孝復興。 行程紀錄: 06:50 三重大同路口前搭國光客運1802前往基隆火車站。 07:35 基隆火車站前下車，前往仁祥醫院站搭基隆客運791，我們搭到07:20發的那班車 08:20 南雅南新宮前下車。整裝上廁所 08:34 出發。沿著南新宮的那條小巷子前進，穿過民宅後到達一條產業道路盡頭的停車場。 08:40 停車場旁的登山口，開始攀登。 08:44 水泥橋，過橋後路徑開始變窄，開始陡上前往稜線。 08:57 上稜線，往南子吝山岔路口，取左。 09:05 下切半平溪叉路口。 09:19 半平溪，天氣太熱了，在陰影處休息，了快半小時，09:45再度出發。 過溪後稍微沿下游一點走，可以看到對岸的上攀點。路非常的陡，從這邊開始離開樹林的遮蔽，要開始狂曬猛曬了。 10:00 接上腰繞路，在休息一下補水，這種天氣不補水真的會昏倒。走一小段後離開腰繞路繼續上攀陡坡。 10:20 遇到”往劍龍稜60分鐘”的路牌。 沿途展望越來越好，可見濱海公路跟海岸邊的哩咾的建築物。 10:27 鋸齒狀的岩石，稜線上遇到的第一段鋸齒狀裸岩。感覺這邊溫度開始飆高。不知道是不是過熱了。總覺得腳使不出力氣，舉步維艱。我們大概花了10分鐘才過這片鋸齒狀的岩石。展望很好，可以遠望整段上坡跟大片岩層。心裡很擔心會熱衰竭，開始思考是不是要撤退。 10:54 第二段裸岩區。獲得上天眷顧。由草山方向飄來一片雲。稍稍阻擋了一下烈日。 11:01 翻過第二段裸岩區。 11:09 出現芒草。準備陡上H381m岔路口。可見茶壺山。 11:17 H381m岔路口。從H381m到H555m中間這段路裸岩越來越密集。 11:47 鋸齒狀岩層形成的瘦稜。腳點不明顯暴露感大。過一半後要從稜左翻到稜右。翻過這塊岩石後即到達水管路岔路口。不取續行。 11:56 小段拉繩翻上稜線上的岩石由稜右翻回稜左。 12:13 一處沙土地，稍稍休息吃東西。還是希望太陽可以小一點。可望陰陽海與南雅社區。 12:34 快要到達H555峰，前段有一小段芒草叢生的地方。我耍白痴穿短袖，被芒草割的癢癢的(汗留下去會痛誒= =) 12:41 到達H555峰，被芒草環繞，沒展望。有一棵樹可以遮陽。但沒展望，這地方也沒啥好留戀的。喝點水後就繼續前進。 12:50...","categories": ["post"],
